// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface ICommunityGovernanceMultiSig {


    event MemberRemoved(uint256 indexed communityId, address indexed member);
    event RespectToDistributeChanged(uint256 indexed communityId, uint256 newAmount);
    event TokensMinted(uint256 indexed communityId, uint256 amount);
    event TopRespectedUsersUpdated(uint256 indexed communityId, address[5] topUsers);
    function updateTopRespectedUsers(uint256 _communityId, address[] memory allMembers) external;
    function getMultiSigInfo(uint256 _communityId) external view returns (uint256 respectToDistribute, address[5] memory topRespectedUsers);
    event ProposalSigned(uint256 indexed communityId, uint256 indexed proposalId, address signer);
    event ProposalExecuted(uint256 indexed communityId, uint256 indexed proposalId);
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface ICommunityGovernanceContributions {

    struct Contribution {
        string name;
        string description;
        string[] links;
    }
        struct Group {
        address[] members;
    }

    event ContributionSubmitted(address indexed user, uint256 indexed communityId, uint256 weekNumber, uint256 contributionIndex);
    event GroupsCreated(uint256 indexed communityId, uint256 weekNumber, uint256 groupCount);
    event RespectUpdated(address indexed user, uint256 indexed communityId, uint256 weekNumber, uint256 respectAmount, uint256 averageRespect);

    function createGroupsForCurrentWeek(uint256 _communityId) external;
    function getGroupsForWeek(uint256 _communityId, uint256 _weekNumber) external view returns (Group[] memory);
    function getWeeklyContributors(uint256 _communityId, uint256 _week) external view returns (address[] memory);
    function updateRespectData(uint256 _communityId, address _user, uint256 _weekNumber, uint256 _respect) external;
    function getAverageRespect(address _user, uint256 _communityId) external view returns (uint256);
    function getCurrentWeek(uint256 _communityId) external view returns (uint256);
    function updateAllUsersRespectData(uint256 _communityId) external;
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface ICommunityGovernanceProfiles {
    enum CommunityState { ContributionSubmission, ContributionRanking }

    event ProfileCreated(address indexed user, string username, bool isNewProfile);
    event CommunityJoined(address indexed user, uint256 indexed communityId, bool isApproved);
    event UserApproved(address indexed user, uint256 indexed communityId, address indexed approver);
    event CommunityCreated(uint256 indexed communityId, string name, address indexed creator, address tokenAddress);
    event CommunityStateChanged(uint256 indexed communityId, CommunityState newState);
    event RespectToDistributeChanged(uint256 indexed communityId, uint256 newAmount);
    event MemberRemoved(uint256 indexed communityId, address removedMember);
    event TokensMinted(uint256 indexed communityId, uint256 amount);

     function removeMemberFromCommunity(uint256 _communityId, address _member) external;
     function getRespectToDistribute(uint256 _communityId) external view returns (uint256);
     //function setRespectToDistribute(uint256 _communityId, uint256 _amount) external;
     function getUserProfile(address _user) external view returns (string memory username, string memory description, string memory profilePicUrl);
     function getUserCommunityData(address _user, uint256 _communityId) external view returns (uint256 communityId, bool isApproved, address[] memory approvers);
     function getCommunityProfile(uint256 _communityId) external view returns (
        string memory name,
        string memory description,
        string memory imageUrl,
        address creator,
        uint256 memberCount,
        CommunityState state,
        uint256 eventCount,
        address tokenContractAddress
    );
    function getCommunityMembers(uint256 _communityId) external view returns (address[] memory memberAddresses, string[] memory memberUsernames);
     //function removeMember(uint256 _communityId, address _member) external;
     //function mintTokens(uint256 _communityId, uint256 _amount) external;
}

